                    if (quest.Id == "260" && summerRain + nonRainSummerQuest < 5 || quest.Id == "254" && summerRain + nonRainSummerQuest < 12 || quest.Id == "256" && summerRain + nonRainSummerQuest < 10 || quest.Id == "262" && summerRain + nonRainSummerQuest < 4 || quest.Id == "264" && summerRain + nonRainSummerQuest < 6)
