                    }
                    // Only accept potato if there has been enough rain
                    if (quest.Id == "192" && (springFairy == -1 && springRain + nonRainSpringQuest < 6))
                    {
                        continue;
                    }
                    // cauli
                    if (quest.Id == "190" && (springFairy == -1 && springRain + nonRainSpringQuest < 12))
                    {
                        continue;
                    }
                    // parsnip
                    if (quest.Id == "24" && (springFairy == -1 && springRain + nonRainSpringQuest < 4))
                    {
                        continue;
                    }
                    // bean
                    if (quest.Id == "188" && (springFairy == -1 && springRain + nonRainSpringQuest < 10))
                    {
                        continue;
                    }

                    // If weekend, needs to rain
                    if (day % 7 == 0 || day % 7 == 6)
                    {
                        if (!isRain)
                        {
                            continue;
                        }
                    }
                    quests += $"\t{day}\tRecipes: {currentRecipes}\t{Item.Get(quest.Id).Name}";

                    // Account for 3rd quest on week that ends Spring 20
                    if (questsForWeek < 2 || day == 20)
                    {
                        if (do3mail)
                        {
                            currentRecipes++;
                            done3mail = true;
                        }
                        if (do7mail)
                        {
                            currentRecipes++;
                            done7mail = true;
                        }
                        friendship += 20;
                        if (day == 20)
                        {
                            friendship += 640;
                        }else if (friendship > 500)
                        {
                            friendship += 80;
                        }
                        else
                        {
                            friendship += 45;
                        }

                        friendship += 150;

                        if (!done3mail && friendship > 750)
                        {
                            do3mail = true;
                        }

                        if (!done7mail && friendship > 1750)
                        {
                            do7mail = true;
                        }

                        if (day > 28 && firstSummerQuest == 9999 && day != 31)
                        {
                            firstSummerQuest = day;
                        }
                        if (!isRain)
                        {
                            if (day < 29)
                            {
                                nonRainSpringQuest++;
                            }
                            else {
                                nonRainSummerQuest++;
                                    }
                        }
                        questsForWeek++;
                        questCount++;
                        // Spring search need to open mail
                        if (questCount == 4)
                        {
                            //availableMailRecipes++;
                            //availableRecipes++;
                        }
                        if (!cropItems.Contains(quest.Id))
                        {
                            availableTVRecipes = 0;

                        }
                    }

                    // Success! Report if needed
                    if (questCount == 8)
