                            //string line = $"{gameId}";
                            stream.WriteLine(line);
                            stream.Close();
                            Console.WriteLine(line);
                        }
                        return true;
                    }

                    trashItems.UnionWith(dayTrash);
                    trashString += $"{String.Join(", ", dayTrashFull)}";

                    if (trashItems.Contains(quest.Id))
                    {
                        trashItems.Remove(quest.Id);
                    } else if (quest.Id == "167")
                    {
                        boughtJoja++;
                    }
                }
                // Quest didnt work, try with more recipes known
                else
                {
                    if (availableTVRecipes > 0 || availableMailRecipes > 0)
                    {
                        // Crops don't change
                        if (!cropItems.Contains(quest.Id))
                        {
                            if (availableTVRecipes > 0)
                            {
                                availableTVRecipes--;
                            }
                            else
                            {
                                availableMailRecipes--;
                            }
                            if (ValidSeedRecursive(false, gameId, day, trashItems, reportString, questsForWeek, questCount, currentRecipes + 1, availableRecipes, foundQuests, friendship, springRain, summerRain, quests, trashString, report, nonRainSpringQuest, nonRainSummerQuest, new HashSet<Trash1_6.Trash.TrashItem>(dayTrashFull), firstSummerQuest,springFairy,availableMailRecipes,availableTVRecipes,boughtJoja, do3mail, do7mail,done3mail,done7mail))
