                                if (!report)
                                {
                                    return true;
                                }
                            }
                        }
                    }
                    // Need quest on 20th
                    if (day == 20)
                    {
                        return false;
                    }
                    if (friendship < 2000 && friendship > 0)
                    {
                        friendship -= 2;
                    }
                }

            }
            return false;
        }
