        public static double Search(uint startId, uint endId, int blockSize, out List<uint> validSeeds)
        {
            Stopwatch stopwatch = Stopwatch.StartNew();
            var bag = new ConcurrentBag<uint>();
            var partioner = Partitioner.Create(startId, endId, blockSize);
            //for(int seed = startId; seed < endId; seed++) { 
            Parallel.ForEach(partioner, (range, loopState) =>
            {
                for (uint seed = (uint)range.Item1; seed < range.Item2; seed++)
                {
                    if (ValidSeedv2(seed))
                    {
                        bag.Add(seed);
                        FileStream fs = null;
                        int i = 0;
                        while (fs == null)
                        {
                            try
                            {
                                fs = new FileStream($"MarriageSeededV10_{i}.txt", FileMode.Append);
                            }
                            catch
                            {
                                i++;
                            }
                        }
                        StreamWriter stream = new StreamWriter(fs);
                        stream.Write($"{seed},");
                        Console.WriteLine(seed);
                        stream.Close();
                    }
                }
            });
            double seconds = stopwatch.Elapsed.TotalSeconds;
            Console.WriteLine($"Found: {bag.Count} sols in {seconds.ToString("F2")} s");
            validSeeds = bag.ToList();
            validSeeds.Sort();
            return seconds;
        }
